<?php

function makeRequest($url)
{
    return file_get_contents($url);
}

function getATMInfoFromOSM()
{
    $apiUrl = "https://overpass-api.de/api/interpreter?data=[out:json];node[amenity=atm](53.8250,23.1520,56.1650,32.7470);out;";
    $jsonData = makeRequest($apiUrl);
    $atmData = json_decode($jsonData, true);
    return $atmData;
}

function parseWorkTime($workTime)
{
    $daysOfWeek = explode(',', $workTime);

    if (count($daysOfWeek) == 7) {
        return 'Работает ежедневно';
    }

    $workSchedule = [];

    foreach ($daysOfWeek as $day) {
        preg_match('/([^\[]+)\[([^\]]+)\]/', $day, $matches);
        $workSchedule[] = $matches[1] . '[' . $matches[2] . ']';
    }

    return implode(',', $workSchedule);
}

$osmATMData = getATMInfoFromOSM();

$markers = [];
$usedAddresses = [];

foreach ($osmATMData['elements'] as $atm) {
    $address = $atm['tags']['addr:street'] . ' ' . $atm['tags']['addr:housenumber'];
    $uniqueId = md5($address);

    if (!in_array($uniqueId, $usedAddresses)) {
        $currencyColor = ($atm['tags']['currency'] == 'BYN') ? 'green' : (($atm['tags']['currency'] == 'USD') ? 'blue' : 'green');
        $twentyFourSevenColor = ($atm['tags']['opening_hours'] == '24/7') ? 'green' : 'red';

        $markers[] = [
            'lat' => $atm['lat'],
            'lng' => $atm['lon'],
            'popup' => '<b>' . $atm['tags']['name'] . '</b><br>Улица: ' . $atm['tags']['addr:street'] . '<br>Номер банкомата: ' . $atm['tags']['atm'] .
                '<br><span style="color: ' . $currencyColor . ';">Выдаваемая валюта: ' . $atm['tags']['currency'] . '</span>' .
                '<br><span style="color: ' . $twentyFourSevenColor . ';">Работает 24/7: ' . $atm['tags']['opening_hours'] . '</span>'
        ];

        $usedAddresses[] = $uniqueId;
    }
}
