function initMap() {
            var map = L.map('map').setView([53.9045, 27.5615], 6);

            L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
                attribution: '© OpenStreetMap contributors'
            }).addTo(map);

            var markers = <?php echo json_encode($markers); ?>;

            var markersCluster = L.markerClusterGroup();

            var geojsonLayer;

            // Создаем слой GeoJSON
            geojsonLayer = L.geoJSON(geoJsonData, {
                onEachFeature: function (feature, layer) {
                    var popupContent = '<b>' + (feature.properties.name || 'Название не указано') + '</b><br>' + 
                        'Часы работы: ' + (feature.properties.opening_hours || 'Часы работы не указаны') + '<br>' +
                        'Оператор: ' + (feature.properties.operator || 'Оператор не указан');
                    layer.bindPopup(popupContent);
                }
            });

            map.addLayer(markersCluster); // Добавим кластер на карту

            // Фильтрация маркеров
            function filterMarkers() {
                var unknownCheckbox = document.getElementById('unknownCheckbox');
                var needsTagsCheckbox = document.getElementById('needsTagsCheckbox');
                var allOkCheckbox = document.getElementById('allOkCheckbox');

                markersCluster.clearLayers(); // Очистим кластер перед фильтрацией

                geojsonLayer.eachLayer(function (layer) {
                    var properties = layer.feature.properties;

                    var hasName = properties.name && properties.name.trim() !== '';
                    var hasOpeningHours = properties.opening_hours && properties.opening_hours.trim() !== '';
                    var hasOperator = properties.operator && properties.operator.trim() !== '';

                    var isVisible =
                        (unknownCheckbox.checked && !(hasName || hasOpeningHours || hasOperator)) ||
                        (needsTagsCheckbox.checked && (hasName || hasOpeningHours || hasOperator)) ||
                        (allOkCheckbox.checked && hasName  && hasOpeningHours && hasOperator);

                    if (isVisible) {
                        markersCluster.addLayer(layer);
                    }
                });
            }

            // Вызов функции filterMarkers при изменении состояния чекбоксов
            document.getElementById('unknownCheckbox').addEventListener('change', filterMarkers);
            document.getElementById('needsTagsCheckbox').addEventListener('change', filterMarkers);
            document.getElementById('allOkCheckbox').addEventListener('change', filterMarkers);

            filterMarkers(); // Вызываем фильтрацию при загрузке страницы
        }

        initMap();
    </script>
</body>
